import Card from '../UI/Card';

import styles from './UsersList.module.css';

const UsersList = (props) => {
  const { users } = props;

  // let layout = <h1>No users...</h1>
  //
  // if (users.length) {
  //   layout = users.map(({ name, age }) => <li key={ Math.random() }>`${ name } (${ age } years old)`</li>);
  // }

  return (
    <Card className={ styles.users }>
      <ul>
        { users.map(({ name, age }) => <li key={ Math.random() }>{ name } { age } years old)`</li>) }
      </ul>
    </Card>
  );
};

export default UsersList;
